import React from 'react';
import {useState} from 'react';
import { Form } from 'react-bootstrap';
import {Link} from 'react-router-dom';
import Sidebar from "./Sidebar";
function Profile (){ 
   const [name, setName] = useState("Sadia Liaquat");
   const [email, setEmail] = useState("sadialiaquat988@gmail.com");
   const [password, setPassword] = useState("*******");
   const [phone, setPhone] = useState("03155093841");
 function  formSubmitHandler (e) {
      e.preventDefault();}
  
   return(<>
    <Sidebar>
   <div className='profile-main'>
    <div className="profile-heading"> Profile Settings</div> 
    <div className='sub-main'>
    <Form onSubmit={formSubmitHandler}>  
    <fieldset>     
              <div className='form'>
              
                <label className='label'>Name</label><br></br>
                
                <input
                  value={name}
                  onChange={e => setName(e.target.value)}
                  type='name'
                  className="input"
                />
              </div>
              <div className='form'>
                <label className='label'>Email address</label>
                <input 
                  value={email}
                  onChange={e => setEmail(e.target.value)}
                  type='email'
                  className='input'
                />
              </div>
              <div className='form'>
                <label className='label'>Password</label>
                <input
                  value={password}
                  onChange={e => setPassword(e.target.value)}
                  type='password'
                  className='input'
                />
              </div>
              <div className='form'>
                <label className='label'>Phone Number</label>
                <input
                  value={phone}
                  onChange={e => setPhone(e.target.value)}
                  type='phone'
                  className='input'
                />
              </div>
              <div>
              <Link to='/home'>
              <button type='submit' className='update-button'>
                Update your profile
              </button></Link></div>
           </fieldset>
          </Form>
          </div>
   </div></Sidebar></>

   )
}
 
export default Profile
